import React, { useEffect, useState } from "react";

import "./Local.css";

const Local = () => {
  const apiKey = "749d030bb028567c6df26b3941472ec9";

  const [data, setData] = useState("");

  const setWeatherDetails = (nomeCidade, uf) => {
    axios
      .get(
        `http://api.openweathermap.org/data/2.5/weather?q=${nomeCidade}&appid=${apiKey}`
      )
      .then((res) => {
        console.log("response", res);
      })
      .catch((err) => {
        console.log("error", err);
      });
  };

  useEffect(() => {
    setWeatherDetails("Ipatinga", "MG");
  }, []);

  return (
    <div className="lugar text-center">
      <h2 className="cidade">Cidade, Estado</h2>

      <h1 className="temperatura">00ºC</h1>
    </div>
  );
};

export default Local;
